import { Icon, Menu } from "antd";
import Link from "next/link";
const links = () => (
	<>
		<Link to="/">
			<Icon type="home" />
		</Link>
		<Link to="/about-me">
			<Icon type="user" />
		</Link>
	</>
);

export default links;
